        if (dict.Count == 0) {
            return false;
        }
        bool isLower = dict.Keys.All(x => x.All(y => char.IsLower(y)));
        bool isUpper = dict.Keys.All(x => x.All(y => char.IsUpper(y)));
        return isLower || isUpper;

