        for (int i = 0; i < op.Count; i++) {
            if (op[i] == "+") {
                result += operand[i + 1];
            } else if (op[i] == "-") {
                result -= operand[i + 1];
            } else if (op[i] == "*") {
                result *= operand[i + 1];
            } else if (op[i] == "/") {
                result /= operand[i + 1];
            } else if (op[i] == "**") {
                result = (long)Math.Pow(result, operand[i + 1]);
            }
        }
